import { Select } from "antd";
import { useNavigate } from "react-router-dom";



function AdminNavBar(){
    const {Option,OptGroup} = Select;
    const navigate = useNavigate();

  
    const handleChange = (value,group)=>{
    
        navigate(`${value}`);
    };

    return(
        <div>
            <Select value={selectedUsers} onChange={(value)=>handleChange(value,'Users')}>
                <OptGroup label='Users'/>
                <Option value='userBlocking'>Blocking</Option>
                <Option value='orderStatusChange'>Change order status</Option>
            </Select>
            <Select value={selectedStatistics} onChange={(value)=>handleChange(value,'Statistics') }>
            <OptGroup label='Statistics'/>
                <Option value='usersData'>Get users data</Option>
                
            </Select>
            <Select value={selectedManegment} onChange={(value)=>handleChange(value,'Manegment')}>
            <OptGroup label='Manegment'/>
                <Option value = 'standart-pizza-list'></Option>
            </Select>
        </div>
    )
}
export default AdminNavBar;
